import React from "react";
import "./App.css";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/questions")
      .then((res) => res.json())
      .then((data) => setData(data));
  });

  return (
    <div className="App">
      <p>{data.questions}</p>

    </div>
  );
}

export default App;
